export function Create() {
    return (
        <>
            <h1>Create</h1>
            <div className="s4dcycle">{/*This is the 4D cycle bar*/}
                <h2>The 4D Cycle</h2>
                <div className= "gallery">
                <p1>Discern</p1>
                            <p>Follow the leading of the Holy Spirit to pursue a solution.</p>
                            <div className= "button1">learnMore</div>
                </div>
                <p1>To effectively lead projects using the 4D cycle...</p1>
            </div>
        </>
    )
}
